import React from "react";
// import { useForm, SubmitHandler } from "react-hook-form";

// type Inputs = {
//   example: string;
//   exampleRequired: string;
// };

const RegisterForm = () => {
  return (
    <>
      <h1>Регистрация</h1>
      <form>
        <label className="label">
          Логин
          <input type="text" />
          </label>
          <p className="error"></p>
          <label className="label">
            Пароль
            <input type="text" />            
        </label>
      </form>
    </>
  );
};

export default RegisterForm;
